import { Component } from '@angular/core';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.scss']
})
export class DashboardComponent {
}
<div class="container-header">
  <div class="p-col-12 p-grid">
    <div class="p-col-12">
      <h2 class="text-center title-header pt-4">Te damos la bienvenida al Sistema de Control de Planeaciones Docente</h2>
    </div>
    <div class="p-col-12 pt-4 pl-3 pb-5">
      <p-button class="p-col-6" label="Clases"></p-button>
      <p-button class="p-col-6 ml-2" label="Usuario"></p-button>
    </div>
  </div>
</div>

<div class="mt-6">
  <p-card [style]="{ width: '400px' }">
    <div class="p-col-12 grid materia">
      <div class="icono-texto">
        <h3>{{ 'Quimica' }}</h3>
        <i class="pi pi-user" style="font-size: 25px; margin-left: 10px;"></i>
      </div>
    </div>
  </p-card>
</div>

<style>
  .materia {
    display: flex;
    justify-content: center;
    align-items: center;
  }

  .icono-texto {
    display: flex;
    align-items: center;
  }
</style>
